/* eslint-disable no-undef */
function registerEduFont(jsPDF) {
    var font =``;

    var callAddFont = function () {
        this.addFileToVFS("EduNSWACTCursive.ttf", font);
        this.addFont("EduNSWACTCursive.ttf", "EduFont", "normal");
    };

    jsPDF.API.events.push(['addFonts', callAddFont]);
}